import React from "react";
import './toDoList.css';
import TodoItem from "./todoItem";
import Button from "./button";
let tasks = [{
    name: "complete smt",
    id: 1,
    checked: false

}, {
    name: "complete smt",
    id: 2,
    checked: false
}, {
    name: "complete smt",
    id: 3,
    checked: false
}];


class Lists extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            elements: []
        }
    }

    render() {
        return (
            <>
                <div className="todoList">
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                </div>
                <Button />
            </>
            
        );
    }
}

export default Lists
